import React, { Component } from 'react';
import './button.css';


class Button extends React.Component{
  render(){
    const Button = () => {
      const handleClick = () => console.log('Clicked!');
    }
  return(
    <div>
      <button type="button" onClick={handleClick}>
        Click me!
      </button>
    </div>

    )
  }
}

export default Button;
